                <h3>Welcome to the world of</h3>
                <h1 className='my-name' style={{fontSize: '80px', textAlign: 'center', color: 'white'}}>Christopher Nicholas Reeves</h1>
            </div>
            <div className='col'></div>
        </div>
    )
}

export default MyName;
